def get_max_triples(n):
    # Generate the array based on given formula
    a = [i * i - i + 1 for i in range(1, n+1)]

    # Count of triples
    count = 0

    # Iterate through all possible triples
    for i in range(n):
        for j in range(i+1, n):
            for k in range(j+1, n):
                # Check if the sum of the triple is divisible by 3
                if (a[i] + a[j] + a[k]) % 3 == 0:
                    count += 1

    return count

